import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image, TextInput, Button, Alert } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      {/* <Text>Enfim meu primeiro APP!</Text>
      <StatusBar style="auto" /> */}
      <View style={styles.navbar}>
        <Text>Full Stack Eletro</Text>
      </View>
      <Image source={require('./assets/icon.png')} style={styles.logo}
      />

      <TextInput style={styles.input} placeholder="Digite seu usuario"/>

      <TextInput style={styles.input} placeholder="Digite sua senha"
        secureTextEntry={true} />

      <Button class="button" title="Login" onPress={() => Alert.alert('Alerta de clique!')}
      />
       <Button class="button" title="limpa" onPress={() => Alert.alert('Alerta de clique!')}
      />

    </View>
  );
}

const styles = StyleSheet.create({
  navbar:{
    backgroundColor: 'yellow',
    width: '100%'
  },
  container: {
    flex: 1,
    backgroundColor: '#ffb6c1',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 150,
    height: 150,
    borderRadius: 100
  },
  input:{
    marginTop: 10,
    padding: 10,
    width: 350,
    backgroundColor:'#fff',
    fontSize: 15,
    borderRadius: 50

  },
  button: {
    width: 200
  }
});
